--Delete metadata for dropped tables: du_key_finding, du_refi_plus_finding, liability_new
WITH dropped_table_names (table_name) AS (
    VALUES ('du_key_finding')
         , ('du_refi_plus_finding')
         , ('liability_new')
)
   , dropped_table_processes AS (
    SELECT process.dwid AS process_dwid
         , process.name AS process_name
         , dropped_table_names.table_name
    FROM mdi.process
    JOIN mdi.table_output_step
         ON process.dwid = table_output_step.process_dwid
    JOIN dropped_table_names
         ON table_output_step.target_table = dropped_table_names.table_name
             AND table_output_step.target_schema = 'history_octane'
)
   , delete_field_definitions AS (
    DELETE FROM mdi.edw_field_definition
        USING mdi.edw_table_definition, dropped_table_names
        WHERE edw_field_definition.edw_table_definition_dwid = edw_table_definition.dwid
            AND edw_table_definition.table_name = dropped_table_names.table_name
            AND edw_table_definition.schema_name IN ('staging_octane', 'history_octane')
)
   -- delete join definitions in two stages instead of using an OR clause for performance reasons
   , delete_join_definitions_primary AS (
    DELETE FROM mdi.edw_join_definition
        USING mdi.edw_table_definition primary_table_definition, dropped_table_names
        WHERE edw_join_definition.primary_edw_table_definition_dwid = primary_table_definition.dwid
            AND primary_table_definition.table_name = dropped_table_names.table_name
            AND primary_table_definition.schema_name IN ('staging_octane', 'history_octane')
)
   , delete_join_definitions_target AS (
    DELETE FROM mdi.edw_join_definition
        USING mdi.edw_table_definition target_table_definition, dropped_table_names
        WHERE edw_join_definition.target_edw_table_definition_dwid = target_table_definition.dwid
            AND target_table_definition.table_name = dropped_table_names.table_name
            AND target_table_definition.schema_name IN ('staging_octane', 'history_octane')
)
   , delete_table_definitions AS (
    DELETE FROM mdi.edw_table_definition
        USING dropped_table_names
        WHERE edw_table_definition.table_name = dropped_table_names.table_name
