--edw_join_definition
WITH delete_keys (primary_database_name, primary_schema_name, primary_table_name, target_database_name, target_schema_name, target_table_name, join_condition) AS (
    VALUES ('staging', 'history_octane', 'branch', 'staging', 'history_octane', 'country_type', 'primary_table.br_address_country = target_table.code')
         , ('staging', 'history_octane', 'company', 'staging', 'history_octane', 'country_type', 'primary_table.cm_company_address_country = target_table.code')
         , ('staging', 'history_octane', 'smart_doc', 'staging', 'history_octane', 'doc_key_date_type', 'primary_table.sd_doc_key_date_type = target_table.code')
         , ('staging', 'history_octane', 'smart_doc', 'staging', 'history_octane', 'doc_validity_type', 'primary_table.sd_doc_validity_type = target_table.code')
         , ('staging', 'history_octane', 'smart_doc', 'staging', 'history_octane', 'calendar_rule_type', 'primary_table.sd_expiration_rule_type = target_table.code')
         , ('staging', 'history_octane', 'branch_license', 'staging', 'history_octane', 'branch', 'primary_table.brml_branch_pid = target_table.br_pid')
         , ('staging', 'history_octane', 'construction_cost', 'staging', 'history_octane', 'contractor', 'primary_table.coc_contractor_pid = target_table.ctr_pid')
         , ('staging', 'history_octane', 'lender_settings', 'staging', 'history_octane', 'branch', 'primary_table.lss_fha_home_office_branch_pid = target_table.br_pid')
)
DELETE
FROM mdi.edw_join_definition
    USING delete_keys, mdi.edw_table_definition primary_table, mdi.edw_table_definition target_table
WHERE delete_keys.primary_database_name = primary_table.database_name
  AND delete_keys.primary_schema_name = primary_table.schema_name
  AND delete_keys.primary_table_name = primary_table.table_name
  AND delete_keys.target_database_name = target_table.database_name
  AND delete_keys.target_schema_name = target_table.schema_name
  AND delete_keys.target_table_name = target_table.table_name
  AND primary_table.dwid = edw_join_definition.primary_edw_table_definition_dwid
  AND target_table.dwid = edw_join_definition.target_edw_table_definition_dwid
  AND delete_keys.join_condition = REGEXP_REPLACE( edw_join_definition.join_condition, 't[0-9]+\.', 'target_table.' );
